import logo from './logo.svg';
import './App.css';
import Person from './Person/person';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Hey baby, I'm a React App!</h1>
        <p>And you're still learning!</p>
        <Person name="John" age="37"/>
        <Person name="Peter" age="88"/>
        <Person name="Josephine" age="56"/>
      </div>
    );
  }
}

export default App;
